import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const messages = [
  "Bugün yeni öğrenci kayıtlarını kontrol etmeyi unutmayın.",
  "Mesajlarınızda yanıt bekleyen öğrenci olup olmadığını gözden geçirin.",
  "Öğrencilerin başarılarını artırmak için duyuru yapmayı ihmal etmeyin.",
  "Her zaman yanınızdayız, iyi çalışmalar!",
];

const TeacherHomePage = ({ username }) => {
  const [teacher, setTeacher] = useState(null);
  const [loading, setLoading] = useState(true);
  const [infoMessage, setInfoMessage] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const teacherRes = await axios.get(`http://localhost:8080/api/auth/teacher/me?username=${username}`);
        setTeacher(teacherRes.data);
        // Sayfa her yüklendiğinde random mesaj seç
        setInfoMessage(messages[Math.floor(Math.random() * messages.length)]);
      } catch (error) {
        console.error('Veri çekme hatası:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [username]);

  const handleAddStudent = () => navigate('/ogrenci-ekle');
  const handleShowStudents = () => navigate('/ogrenci-listesi');
  const handleViewMessages = () => navigate('/ogretmen-mesajlar');
  const handleSendMessage = () => navigate('/teacher/send-message', { state: { teacher } });
  const handleSendAnnouncement = () => navigate('/teacher/send-announcement', { state: { teacher } });
  const handleLogout = () => navigate('/teacher-login');

  if (loading) return <div style={styles.loading}>Yükleniyor...</div>;
  if (!teacher) return <div style={styles.error}>Öğretmen bilgisi bulunamadı.</div>;

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h2 style={styles.title}>Hoşgeldiniz, {teacher.name}!</h2>
      </header>

      <div style={styles.infoBox}>
        <p>{infoMessage}</p>
      </div>

      <div style={styles.buttonGroup}>
        <button style={styles.buttonBlue} onClick={handleShowStudents}>Kayıtlı Öğrenciler</button>
        <button style={styles.buttonGreen} onClick={handleAddStudent}>Öğrenci Ekle</button>
        <button style={styles.buttonOrange} onClick={handleSendMessage}>Mesaj Gönder</button>
        <button style={styles.buttonPurple} onClick={handleSendAnnouncement}>Duyuru Yap</button>
        <button style={styles.buttonRedOrange} onClick={handleViewMessages}>Mesajları Görüntüle</button>
        <button style={styles.buttonRed} onClick={handleLogout}>Çıkış</button>
      </div>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: 900,
    margin: '40px auto',
    padding: 20,
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    backgroundColor: '#f9f9f9',
    borderRadius: 12,
    boxShadow: '0 8px 16px rgba(0,0,0,0.1)',
  },
  header: {
    marginBottom: 20,
  },
  title: {
    color: '#333',
    fontWeight: 600,
  },
  infoBox: {
    backgroundColor: '#e3f2fd',
    borderLeft: '6px solid #2196F3',
    padding: '12px 20px',
    marginBottom: 30,
    borderRadius: 6,
    fontSize: 16,
    color: '#0d47a1',
    fontStyle: 'italic',
  },
  buttonGroup: {
    display: 'flex',
    flexWrap: 'wrap',
    gap: 12,
  },
  buttonBase: {
    padding: '10px 18px',
    border: 'none',
    borderRadius: 6,
    fontWeight: 600,
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
    flex: '1 1 180px',
    color: '#fff',
  },
  buttonBlue: {
    backgroundColor: '#2196F3',
  },
  buttonGreen: {
    backgroundColor: '#4CAF50',
  },
  buttonOrange: {
    backgroundColor: '#FF9800',
  },
  buttonPurple: {
    backgroundColor: '#9C27B0',
  },
  buttonRedOrange: {
    backgroundColor: '#FF5722',
  },
  buttonRed: {
    backgroundColor: '#f44336',
  },
  loading: {
    fontSize: 18,
    textAlign: 'center',
    paddingTop: 60,
  },
  error: {
    fontSize: 18,
    color: 'red',
    textAlign: 'center',
    paddingTop: 60,
  },
};

// Butonlara hover efektini eklemek için küçük bir ekleme
// React inline style ile değil, CSS ile daha kolay yapılır.
// Ama istersen React'te bunu "onMouseEnter" ve "onMouseLeave" ile de yapabiliriz.
// Burada CSS kullanalım:

export default TeacherHomePage;
